INSERT INTO `ibid_articles` VALUES ('4', '现实', '/public/upload/images/1525941045799.jpg', '来源:原创投稿', '<p style=\"border: 0px; margin-top: 0px; margin-bottom: 1em; padding: 0px; text-indent: 2em; color: rgb(51, 51, 51); font-family: Arial, \">忘却又何尝不是记忆的一种形式。</p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 1em; padding: 0px; text-indent: 2em; color: rgb(51, 51, 51); font-family: Arial, \">有时忘却的是极力在选择逃避。</p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 1em; padding: 0px; text-indent: 2em; color: rgb(51, 51, 51); font-family: Arial, \">你看到的盲目风清是逃避的一种，</p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 1em; padding: 0px; text-indent: 2em; color: rgb(51, 51, 51); font-family: Arial, \">你永远不懂那逃避的背后是多么残忍的痛。</p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 1em; padding: 0px; text-indent: 2em; color: rgb(51, 51, 51); font-family: Arial, \">一曰残忍谓之痛</p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 1em; padding: 0px; text-indent: 2em; color: rgb(51, 51, 51); font-family: Arial, \">二曰痛之所及谓之悲</p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 1em; padding: 0px; text-indent: 2em; color: rgb(51, 51, 51); font-family: Arial, \">三曰悲痛交集处谓之蠢</p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 1em; padding: 0px; text-indent: 2em; color: rgb(51, 51, 51); font-family: Arial, \">此三曰至及又是怎样一种撕心裂肺的逢场作戏</p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 1em; padding: 0px; text-indent: 2em; color: rgb(51, 51, 51); font-family: Arial, \">谁微笑着享受辜负，</p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 1em; padding: 0px; text-indent: 2em; color: rgb(51, 51, 51); font-family: Arial, \">谁是谁的今生救赎？</p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 1em; padding: 0px; text-indent: 2em; color: rgb(51, 51, 51); font-family: Arial, \">当太阳西沉</p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 1em; padding: 0px; text-indent: 2em; color: rgb(51, 51, 51); font-family: Arial, \">许是所有如初的美好</p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 1em; padding: 0px; text-indent: 2em; color: rgb(51, 51, 51); font-family: Arial, \">不过风景旧曾谙。</p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 1em; padding: 0px; text-indent: 2em; color: rgb(51, 51, 51); font-family: Arial, \">仗剑天涯</p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 1em; padding: 0px; text-indent: 2em; color: rgb(51, 51, 51); font-family: Arial, \">孤坐未央，</p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 1em; padding: 0px; text-indent: 2em; color: rgb(51, 51, 51); font-family: Arial, \">千里字行，</p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 1em; padding: 0px; text-indent: 2em; color: rgb(51, 51, 51); font-family: Arial, \">无语凝噎。</p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 1em; padding: 0px; text-indent: 2em; color: rgb(51, 51, 51); font-family: Arial, \">——这便是现实！</p><p><br/></p>', '文／秋天的风', '[]', '', '', '1', '0', '1', '', '1', '2018-05-10 16:04:59', '2018-05-10 16:04:59');
INSERT INTO `ibid_articles` VALUES ('5', '大度也是一种美德', '/public/upload/images/1525941638949.jpg', '有一位著名的音乐家，在成名前曾经担任过俄国彼德耶夫公爵家的私人乐队的队长。\n\n突然有一天，公爵决定解散这支乐队，乐手们听到这个消息的时候，一时间全都面面相觑、心慌意乱，不知道如何是好。看着这些和自己一起同甘共苦许多年的亲密战友，他睡不安寝、食不甘味，绞尽脑汁、想来想去，忽然有了一个主意。', '<p style=\"font-family: \">他立即谱写了一首《告别曲》，说是要为公爵做最后一场独特的告别演出，公爵同意了。</p><p style=\"font-family: \">这一天晚上，因为是最后一次为公爵演奏，乐手们表情呆滞、万念俱灰，根本打不起精神，但是看在与公爵一家相处这些日子的情份上，大家还是竭尽所能、尽心尽力地演奏起来。</p><p style=\"font-family: \">这首乐曲的旋律一开始极其欢悦优美，把与公爵之间的<a href=\"http://www.duwenzhang.com/\" style=\"color: rgb(51, 51, 51); text-decoration-line: none;\">情感</a>和<a href=\"http://www.duwenzhang.com/huati/meihao/index1.html\" style=\"color: rgb(51, 51, 51); text-decoration-line: none;\">美好</a>的<a href=\"http://www.duwenzhang.com/huati/youyi/index1.html\" style=\"color: rgb(51, 51, 51); text-decoration-line: none;\">友谊</a>表达得淋漓尽致，公爵深受<a href=\"http://www.duwenzhang.com/huati/gandong/index1.html\" style=\"color: rgb(51, 51, 51); text-decoration-line: none;\">感动</a>。渐渐地，乐曲由明快转为委婉，又渐渐转为低沉，最后，<a href=\"http://www.duwenzhang.com/huati/beishang/index1.html\" style=\"color: rgb(51, 51, 51); text-decoration-line: none;\">悲伤</a>的情调在大厅里弥漫开来。</p><p style=\"font-family: \">这时，只见一位乐手停了下来，吹灭了乐谱上的蜡烛，向公爵深深地鞠了一躬，然后悄悄地<a href=\"http://www.duwenzhang.com/huati/likai/index1.html\" style=\"color: rgb(51, 51, 51); text-decoration-line: none;\">离开</a>了。过了一会儿，又有一名乐手以同样的方式离开了。就这样，乐手们一个接着一个地离去了，到了最后，空荡荡的大厅里，只留下了他一个人。只见他深深地向公爵鞠了一躬，吹熄了指挥架上的蜡烛，偌大的大厅刹那间暗下了下来。</p><p style=\"font-family: \">正当他也像其他乐手一样，真要独自默默地离开的时候，公爵的情绪已经达到了顶点，他再也忍不住了，大声地叫了起来：&quot;这是到底怎么一回事呢？&quot;他真诚而深情地回答说：&quot;公爵大人，这是我们全体乐队在向您做最后的告别呀！&quot;这时候公爵突然省悟了过来，情不自禁地流出了<a href=\"http://www.duwenzhang.com/huati/yanlei/index1.html\" style=\"color: rgb(51, 51, 51); text-decoration-line: none;\">眼泪</a>：&quot;啊！不！请让我再考虑一下。&quot;</p><p style=\"font-family: \">就这样，他用一首《告别曲》的奇特氛围，<a href=\"http://www.duwenzhang.com/huati/chenggong/index1.html\" style=\"color: rgb(51, 51, 51); text-decoration-line: none;\">成功</a>地使公爵将全体乐队队员留了下来。他就是被誉为&quot;音乐之父&quot;的世界著名音乐家－海登，</p><p style=\"font-family: \">在滚滚红尘中，作为芸芸众生的你我有不少人会这样做：你对我不好，我也不会对你好。比如，在被抛弃、被辞退、被退学的时候，往往会愤愤离去，甚至采取报复行为；还有这样一种情况，有的人在抛弃对方或者准备跳槽时，也不愿意给对方留下一个好的印象，结果出现了一种糟糕的结局。相反，海登深知，即便是最后的时光，也要一样无限美好地离去，为的是给双方留下一些更美好的或是更值得他日<a href=\"http://www.duwenzhang.com/huati/huiyi/index1.html\" style=\"color: rgb(51, 51, 51); text-decoration-line: none;\">回忆</a>的东西。结果，他的<a href=\"http://www.duwenzhang.com/huati/zhenqing/index1.html\" style=\"color: rgb(51, 51, 51); text-decoration-line: none;\">真情</a>大度告别扭转了局面。</p><p style=\"font-family: \">聪明如你我者，当你对他人多一点<a href=\"http://www.duwenzhang.com/huati/kuanrong/index1.html\" style=\"color: rgb(51, 51, 51); text-decoration-line: none;\">宽容</a>；多一点大度；多一点容忍；多一点体贴；多一点谅解，与此同时，你自己也会少一些忧愁；少一些<a href=\"http://www.duwenzhang.com/huati/fannao/index1.html\" style=\"color: rgb(51, 51, 51); text-decoration-line: none;\">烦恼</a>；少一些郁闷；少一些闷闷不乐；少一些不快；降低了耗气伤神的砝码，增加了健康<a href=\"http://www.duwenzhang.com/huati/kuaile/index1.html\" style=\"color: rgb(51, 51, 51); text-decoration-line: none;\">快乐</a>的基数，言外之意，善待他人益于己，即便是你不唱高调；也不说空话大话；全权只当是为你个人的长远利益着想，宽容大度一点儿没错！但又能有谁会说宽容大度不也是一种美德呢？</p><p><br/></p>', '作者： 来源：网络文章', '[]', '', '', '2', '0', '1', '', '1', '2018-05-10 16:37:11', '2018-05-10 16:37:11');
